      catch (Exception ex)
      {
        ProjectData.SetProjectError(ex);
        int num = (int) Interaction.MsgBox((object) "Server Oluşturulamadı !", MsgBoxStyle.Critical, (object) "Hata");
        ProjectData.ClearProjectError();
      }
    }

